import React from 'react';
import { Link, useMatch, useResolvedPath } from 'react-router-dom';

export default function Navbar() {
    // return (
    //     <nav className="flex justify-between">
    //         <Link to="/">Home</Link>
    //         <ul>
    //             <CustomLink to="/login">Login</CustomLink>
    //         </ul>
    //     </nav>
    // );
    return (
        <nav className="flex justify-between items-center py-4 border-b-2">
            <div className="text-xl font-bold">harbor</div>
            <div>
                <Link to="/login" className="px-4 py-2 border rounded text-white bg-blue-500 hover:bg-blue-700">log in / sign up</Link>
                <button className="ml-4 px-4 py-2 border rounded">EN</button>
            </div>
        </nav>
    );
}

function CustomLink({ to, children, ...props }) {
    const resolvedPath = useResolvedPath(to)
    const isActive = useMatch({ path: resolvedPath.pathname, end: true })

    return (
        <li className={isActive ? "active" : ""}>
            <Link to={to} {...props}>
                {children}
            </Link>
        </li>
    )
}
